import React from "react";
import { Pagination } from "react-bootstrap";
const ReactPagination = ({ activePage, pageLimit, totalCount }) => {
  return (
    <>
      <Pagination
        className="text-left"
        itemClass="page-item"
        linkClass="page-link"
        prevPageText="Previous"
        nextPageText="Next"
        activePage={activePage}
        pageLimit={pageLimit}
        totalCount={totalCount}
      />
    </>
  );
};
export default ReactPagination;
